import * as React from 'react';
import Paper from '@material-ui/core/Paper';
import {
  ArgumentAxis,
  ValueAxis,
  Chart,
  LineSeries,
  SplineSeries,
} from '@devexpress/dx-react-chart-material-ui';

export default function HeaderChart(){

    return (
      <Paper>
        <Chart
          // data={chartData}
          data={[{lineValue: 10, argument: 1}, {lineValue: 20, argument: 2}, {lineValue: 30, argument: 3}, {lineValue: 40, argument: 4}]}
        >
          <ArgumentAxis />
          <ValueAxis />

          <LineSeries
            name="line"
            valueField="lineValue"
            argumentField="argument"
          />
          <SplineSeries
            name="spline"
            valueField="splineValue"
            argumentField="argument"
          />
        </Chart>
      </Paper>
    );
  }


